import React , { Component } from 'react'
import ListData from './data/clients.json'

class List extends React.Component {
	render() {
		return(
			<div className="box-content">
				{ListData((clientsDetail , indexs)=>{
					return(
						<div className="list">
							<div className="list-img">
							</div>
							<div className="list_info">
								<div className="i_name">{clientsDetail.firstName}</div>
								<div className="i_job">job</div>
								<div className="i_job">position</div>     
							</div>
						</div>
					)
				})}
			</div>
		);
	}
}
export default List
